import { DefaultTheme } from "styled-components";

export const defaultTheme: DefaultTheme = {
  lightBgColor: "#FFFFFF",
  lightBgTextColor: "#FFFFFF",
  colorBgTextColor: "#3A3A3A",
  SubTextColor: "#F7F7F7",
  DescriptColor: "#C0C5C4",
};
